import React from 'react';
import { Link } from "react-router-dom"


export const Card = ({ listTodos }) => {
    return(
        <>
            {listTodos.map(todo => {
                return(
                    <ul key={todo.id}>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </>
    )
}
